import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

const routes: Routes = [
  {
    path: '',
    redirectTo: '/relatorios/cadastros/pessoa',
    pathMatch: 'full',
  },
  {
    path:'',
    children: [
      {
        path:'cadastros',
        loadComponent: ()=> import('./cadastros/cadastros.module')
      },
      {
        path:'acessos',
        loadComponent: ()=> import('./acessos/acessos.module')
      },
      {
        path:'registros',
        loadComponent: ()=> import('./registros/registros.module')
      }
    ]
  }
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class RelatoriosRoutingModule { }
